script: |
  super -f text -I q9465.spq | sort > q9465.out

inputs:
  - name: q9465.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE + + col0 BETWEEN + - 42 - - - 85 * + + col2 AND + col2 * + 60 * 96;
  - name: tab2

outputs:
  - name: q9465.out
    data: |
      46	51	23
      64	77	40
      75	67	58
